keyVal = 0;
keyFlags = 0;

function keyDown(e) {
    if( is.ie ) e = event
    keyVal = 0
    if( e.keyCode == 18 )
        keyFlags = keyFlags | 1
    else if( e.keyCode == 17 )
        keyFlags = keyFlags | 2
    else if( e.keyCode == 16 )
        keyFlags = keyFlags | 4
    else
        keyVal = e.keyCode

    if( keyFlags == 6 && keyVal == 39 ){action49456();}
    if( keyFlags == 2 && keyVal == 100 ){action1264980();}
}

function keyUp(e) {
    if( is.ie ) e = event
    if( e.keyCode == 18 )
        keyFlags = keyFlags & ~1
    else if( e.keyCode == 17 )
        keyFlags = keyFlags & ~2
    else if( e.keyCode == 16 )
        keyFlags = keyFlags & ~4
}

text763515.addInnerText('<div id=\"text763515\"><a id=\"text763515anc\" tabindex=\"89\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text763515Font1\" style=\"position:relative;top:-2px;\" >Vat photopolymerization uses a tank (or vat) full of liquid polymer material. The most common type, Stereolithography (SLA</span ><span class=\"text763515Font2\" style=\"position:relative;top:-2px;\" ><sup >™</sup ></span ><span class=\"text763515Font1\" style=\"position:relative;top:-2px;\" >), uses a UV laser and was the first 3D printing technology invented.\n</span ></p >\n</div>\n');

text763604.addInnerText('<div id=\"text763604\"><a id=\"text763604anc\" tabindex=\"90\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.465\" style=\"margin-left:0px;text-indent:0px;line-height:1.404;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text763604Font1\" style=\"position:relative;top:-2px;\" >A new approach to vat polymerization developed by Carbon</span ><span class=\"text763604Font2\" style=\"position:relative;top:-2px;\" ><sup >®</sup ></span ><span class=\"text763604Font1\" style=\"position:relative;top:-2px;\" > is Continuous Liquid Interface Production</span ><span class=\"text763604Font2\" style=\"position:relative;top:-2px;\" ><sup >™</sup ></span ><span class=\"text763604Font1\" style=\"position:relative;top:-2px;\" > (CLIP</span ><span class=\"text763604Font2\" style=\"position:relative;top:-2px;\" ><sup >™</sup ></span ><span class=\"text763604Font1\" style=\"position:relative;top:-2px;\" >). This photochemical process carefully balances light and oxygen levels to rapidly produce parts. It projects a sequence of UV images allowing the parts to be continuously cured instead of layer-by-layer, resulting in a smoother finish and 100 times faster than SLA printing according to Carbon</span ><span class=\"text763604Font2\" style=\"position:relative;top:-2px;\" ><sup >®</sup ></span ><span class=\"text763604Font1\" style=\"position:relative;top:-2px;\" >.\n</span ></p >\n</div>\n');
